import React, { Component } from 'react';
import DiyList from './DiyList';
import DiyCategory from './DiyCategory';

class Diy extends Component{
    render(){
        return(
            <div>
                <div align="center">
                <img width="300" alt="Angular Logo" src="https://www.costco.co.kr/medias/sys_master/images/ha9/hc0/10418540740638.jpg"/>
                </div>
                <DiyCategory align="left"/>
                <DiyList align="right"/>
            </div>

        );
    }
}

export default Diy;
